import React, { useState } from 'react';
import Accordion from 'react-bootstrap/Accordion';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';

const Services = () => {
    const [typeServiceF, settypeServiceF] = useState(false);

    const handletypeServiceFChange = (e) => {
        //settypeServiceF(!typeServiceF)
        settypeServiceF(e.target.value);
    };

    const [priceF, setPriceF] = useState(false);

    const handlepriceFChange = (e) => {
        //setPriceF(!priceF)
        setPriceF(e.target.value);
    };

    const [timeF, settimeF] = useState(false);

    const handletimeFChange = (e) => {
        //settimeF(!timeF)
        settimeF(e.target.value);
    };

    const data = 
    [
        { type: 'Body Treatment', price: '175', time: '75'},
        { type: 'Body Treatment', price: '130', time: '60'},
        { type: 'Body Treatment', price: '100', time: '50'},
        { type: 'Facial Treatment', price: '175', time: '60'},
        { type: 'Facial Treatment', price: '130', time: '75'},
        { type: 'Facial Treatment', price: '100', time: '40'},
        { type: 'Esthetic', price: '175', time: '75'},
        { type: 'Esthetic', price: '130', time: '75'},
        { type: 'Esthetic', price: '100', time: '60'}
    ];

    const filteredData = data.filter((item) => {
        if (typeServiceF && item.type !== typeServiceF) {
          return false;
        }
        if (priceF && item.price !== parseInt(priceF)) {
          return false;
        }
        if (timeF && item.time !== timeF) {
          return false;
        }
        return true;
    });

    return (
        <div>
          <div style={{ display: 'flex' }}>
            <div>
              <h2>Bachelors</h2>
              <div>
                <label>Type of Service:</label>
                <select value={typeServiceF} onChange={handletypeServiceFChange}>
                    <option value="">All</option>
                    <option value="Body Treatment">Body Treatment</option>
                    <option value="Facial Treatment">'Facial Treatment</option>
                    <option value="Esthetic">Esthetic</option>
                </select>
              </div>
              <div>
                <label>Price:</label>
                <select value={priceF} onChange={handlepriceFChange}>
                    <option value="">All</option>
                    <option value="175">175</option>
                    <option value="130">130</option>
                    <option value="100">100</option>
                </select>
              </div>
              <div>
                <label>Time:</label>
                <select value={timeF} onChange={handletimeFChange}>
                    <option value="">All</option>
                    <option value="40">40</option>
                    <option value="50">50</option>
                    <option value="60">60</option>
                    <option value="75">75</option>
                </select>
              </div>
            </div>
            <div>
              <h3>Filtered Results:</h3>
              <ul>
                {filteredData.map((item, index) => (
                  <li key={index}>
                    Type of Service: {item.type}, Price: {item.price}, Time: {item.time}
                  </li>
                ))}
              </ul>
            </div>
          </div>
        </div>
      );

}
export default Services;
